description:
Retail Therapy 

Lolly Ink, Johnny Sins 

dm Dirty Masseur December 7, 2012


Johnny has been trying to find someone to massage all day. It's a slow Saturday at the mall, and when busty Lolly walks by he insists on giving her a free massage. She's not sure at first, since her husband is picking her up any minute, but soon Johnny's oiled up hands convince her to stay. 


